import "./styles/sidebar.css";

function SidebarLink({ rank, name, points, key }) {
  return (
    <span className="sideBarList" key={key}>
      {rank} {name}
      <div style={{ position: right }}>
        <div className="rightCol">{points}</div>
      </div>
    </span>
  );
}
export default SidebarLink;
